import React from 'react';

const About = () => (
  <section id="about">
    <h2>About Me</h2>
    <p>


I’m a web developer who loves creating responsive, user-friendly websites. Skilled in [mention a few key skills like HTML, CSS, JavaScript, and React], I focus on clean code and a smooth user experience. 

I’m always learning new technologies and enjoy finding creative solutions to problems. Open to new opportunities—let’s connect!
    </p>
  </section>
);

export default About;
